import React, { useEffect } from 'react';
import "../css/navbar.css"

const YourComponent = () => {
  useEffect(() => {
    const body = document.querySelector("body");
    const nav = document.querySelector("nav");
    const modeToggle = document.querySelector(".dark-light");
    const searchToggle = document.querySelector(".searchToggle");
    const sidebarOpen = document.querySelector(".sidebarOpen");

    let getMode = localStorage.getItem("mode");
    if (getMode && getMode === "dark-mode") {
      body.classList.add("dark");
    }

    const handleModeToggle = () => {
      modeToggle.classList.toggle("active");
      body.classList.toggle("dark");

      if (!body.classList.contains("dark")) {
        localStorage.setItem("mode", "light-mode");
      } else {
        localStorage.setItem("mode", "dark-mode");
      }
    };

    modeToggle.addEventListener("click", handleModeToggle);

    searchToggle.addEventListener("click", () => {
      searchToggle.classList.toggle("active");
    });

    const handleSidebarOpen = () => {
      nav.classList.add("active");
    };

    const handleBodyClick = (e) => {
      let clickedElm = e.target;

      if (!clickedElm.classList.contains("sidebarOpen") && !clickedElm.classList.contains("menu")) {
        nav.classList.remove("active");
      }
    };

    sidebarOpen.addEventListener("click", handleSidebarOpen);
    body.addEventListener("click", handleBodyClick);

    return () => {
      modeToggle.removeEventListener("click", handleModeToggle);
      sidebarOpen.removeEventListener("click", handleSidebarOpen);
      body.removeEventListener("click", handleBodyClick);
    };
  }, []); // Empty dependency array to ensure the effect runs only once on mount

  return (
    // Your HTML content goes here
    <div>
      <nav>
  <div className="nav-bar">
    <i className="bx bx-menu sidebarOpen" />
    <span className="logo navLogo">
      <a href="#">CodingLab</a>
    </span>
    <div className="menu">
      <div className="logo-toggle">
        <span className="logo">
          <a href="#">CodingLab</a>
        </span>
        <i className="bx bx-x siderbarClose" />
      </div>
      <ul className="nav-links">
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Portfolio</a>
        </li>
        <li>
          <a href="#">Services</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </div>
    <div className="darkLight-searchBox">
      <div className="dark-light">
        <i className="bx bx-moon moon" />
        <i className="bx bx-sun sun" />
      </div>
      <div className="searchBox">
        <div className="searchToggle">
          <i className="bx bx-x cancel" />
          <i className="bx bx-search search" />
        </div>
        <div className="search-field">
          <input type="text" placeholder="Search..." />
          <i className="bx bx-search" />
        </div>
      </div>
    </div>
  </div>
</nav>

    </div>
  );
};

export default YourComponent;

















